import React from 'react';

const Haircare = () => {
  return (
    <div 
      className="container mx-auto px-4 py-8"
      style={{
        backgroundImage: 'url("/images/home-bg.jpg")',
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        backgroundAttachment: 'fixed'
      }}
    >
      
      {/* Cover Image */}
      <div className="w-full h-64 bg-cover bg-center rounded-xl shadow-lg mb-6" 
        style={{ backgroundImage: 'url("/images/hair.jpg")' }}
      ></div>
      <h1 className="text-3xl font-bold text-center text-pink-700">
        Menstrual Hygiene
      </h1>
      <p className="text-center text-gray-700 mt-4">
        Learn about the importance of menstrual hygiene and tips for staying healthy during your cycle.
      </p>
    </div>
  );
};

export default Haircare;
